import React from "react";

export default function About() {
  return (
    <div className="space-y-6 max-w-3xl mx-auto">
      <h1 className="text-3xl font-bold">About SH Project</h1>
      <p>
        SH Project is a modern health dashboard designed to help you monitor your daily health metrics. 
        It provides hydration tracking, UV exposure monitoring, step counting, and mental health insights.
      </p>
      <p>
        The integrated AI chatbot offers personalized health suggestions, while our accessibility features
        allow you to customize font size and colorblind modes for optimal usability.
      </p>
    </div>
  );
}
